=====Usage notes=====
{{m|en|ye|Ye}} was originally used only for the nominative case (as the subject), and only for the second-person plural. Later, {{m|en|ye}} was used as a subject or an object, either singular or plural, which is the way that {{m|en|you}} is used today. In modern Hiberno-English usage, {{m|en|ye}} is used as a subject or an object in the plural, to contrast with {{m|en|you}} (singular).
