==Catawba==
===Noun===
{{head|chc|noun}}
# [[man]] {{qualifier|adult male human}}, [[men]]
# [[person]], [[people]]
# [[Native American]] [[Indian]](s)
====Usage notes====
* Catawba nouns do not inflect for number.
* Many of Catawba's names for tribes incorporate this word, e.g. {{m|chc|ye iswa|yƒô iswa|lit=people of the river|the Catawba}}, {{m|chc|ye mantera|yƒô manterƒÖ|lit=people born in/on the land|the Cherokee}}.
* The vowel of this word is generally nasalized; this is reflected in different ways or not at all in different transcriptions: {{m|chc|ye}}, {{m|chc|yƒô}}, {{m|chc|yen|ye<sup>n</sup>}}. Sometimes, an initial ''i'', also nasalized, is found: {{m|chc|inyen|i<sup>n</sup>ye<sup>n</sup>}} / {{m|chc|ƒØyƒô}}.
===References===
* 1858, Oscar M. Lieber, ''Vocabulary of the Catawba Language''
* 1900, Albert S. Gatschet, ''Grammatic Sketch of the Catawba Language'' (published in the ''American Anthropologist'')
* 1942, Frank G. Speck and C. E. Shaeffer, ''Catawba Kinship and Social Organization''
* 1945, Frank T. Siebert, Jr., ''Linguistic Classification of Catawba'' (published in the ''International Journal of American Linguistics'')
